import React from "react";
import Header from "../Header/header";
import Body from "../Body/body";
import Footer from "../Footer/footer";


function Home(){
    return(
        <div className="conteudo-site">
            
            <div className="div-header">
            <Header/>
            <br />
            <Body />
            </div>
            <Footer />

        </div>
        


    )    
}

export default Home;
